INSERT INTO `ensiklopedia_data` (`data_id`, `kategori`, `nama`, `jenis`, `deskripsi`, `kandungan`, `manfaat`, `klasifikasi`, `sub_klasifikasi`, `video`, `created_at`, `updated_at`, `is_active`, `cek`) VALUES
('05-01-20185a4f30c71d8bd', 'Algoritma dan Kompleksitas', '3.4 Notasi Omega-Besar dan Tetha-Besar', 'BAB 3. Algorithm Complexity', 'untuk contoh lainnya silahkan download materi dalam bentuk word pada link yang tersedia ya..', 'kilojoule : 1347 kj\r\nkalori : 322 kkal.\r\nlemak : 29,47 g.\r\nprotein : 4,02 g.\r\nkarbohidrat : 17,15 g.\r\nsodium : 14 mg.\r\nkalium : 975 mg.', 'Mengurangi risiko kanker.\r\nSenyawa lain yang ada di dalam alpukat adalah\r\nkarotenoid. Ini adalah senyawa\r\nAntioksidan yang mungkin memiliki\r\nkemampuan sebagai antikanker.\r\nBaik untuk penderita osteoarthtritis.\r\nBerguna untuk mencegah osteoporosis.\r\nMenurunkan kolesterol jahat.\r\nBaik untuk menjaga berat badan dan kesehatan\r\njantung.\r\nKebaikan alpukat untuk kesehatan jantung juga\r\nmungkin signifikan.\r\nBaik bagi kesehatan janin.\r\nBagus untuk mata.\r\nMengurangi stres.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Laurales\r\nfamili : Lauraceae\r\ngenus : Persea\r\nspesies : Persea americana', '', NULL, '2019-10-03 09:54:37', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f30c76ca70', 'Algoritma dan Kompleksitas', '5.2 Minimum dan Maksimum', 'BAB 5. Divide & Conquer (DANDC)', 'Berikut ini adalah contoh masalah dalam mencari nilai minimum dan maksimum.\r\n\r\nMisalkan diberikan tabel A yang berukuran n elemen dan sudah berisi nilai integer, carilah nilai minimum dan maksimum sekaligus di salam tabel tersebut!\r\n\r\nPenyelesaian dengan Algoritma Brute Force\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116779/mod_page/content/7/1.JPG\r\n\r\nPenyelesaian dengan Algoritma Divide and Conquer\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116779/mod_page/content/7/2.JPG\r\n\r\nUkuran tabel hasil pembagian dapat dibuat cukup kecil sehingga mencari minimum dan maksimum dapat diselesaikan (SOLVE) secara lebih mudah. Dalam hal ini, ukuran kecil yang dipilih adalah 1 elemen atau 2 elemen.\r\nBerikut ini contoh algoritmanya.\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116779/mod_page/content/7/3.JPG\r\nReview Contoh\r\n\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116779/mod_page/content/7/4.JPG\r\n\r\nKompleksitas Waktu Asimptotik\r\n\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116779/mod_page/content/7/5.JPG\r\n\r\nBrute Force Vs DANDC\r\nMinMaks1 secara brute force :\r\n  T(n) = 2n  2\r\n\r\nMinMaks2 secara divide and conquer:\r\n  T(n) = 3n/2   2  \r\n\r\nPerhatikan:   3n/2  2 < 2n  2  , n ? 2.\r\n\r\nKesimpulan: Algoritma MinMaks lebih mangkus dengan menggunakan metode Divide and Conquer.', 'kilojoule : 13 kj\r\nkalori : 3 kkal.\r\nlemak : 0,01 g.\r\nprotein : 0,04 g.\r\nkarbohidrat : 0,9 g.\r\nkalium : 10 mg.', 'Mengantur gula darah.\r\nMeningkatkan fungsi otak.\r\nMelindungi jantung.\r\nMeningkatkan penglihatan.\r\nMencegah kanker.\r\nMembuat  rambut sehat.\r\nMeningkatkan daya tahan tubuh.\r\nMenjaga kesehatan tulang.\r\nMenjaga berat badan.\r\nMenyehatkan kulit.  ', 'kindom : Plantae\r\ndivisi:-\r\nkelas : Magnoliopsida\r\nordo : Rhamnales\r\nfamili : Vitaceae\r\ngenus : Vitis\r\nspesies : Vitis vinifera', '', NULL, '2019-10-03 09:55:26', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f37998314e', 'Basis Data', 'Terung', 'Terung (Solanum melongena)', 'Terung berasal dari Asia terutama India dan Birma (Sunarjono, 2016). Terung termasuk ke dalam sayuran Solanaceae yang bisa ditanam baik didataran rendah maupun dataran tinggi. Bentuk buahnya lonjong dengan 2 warna yaitu terung yang buahnya berwarna ungu dan terung yang buahnya berwarna hijau. Daging buahnya berwarna putih dan bijinya berwarna kecokelatan. Panjang buah terong kurang lebih 7 cm terung yang kecil dan yang panjang sekitar 15 cm ', 'kilojoule : 100 kj.\r\nkalori : 24 kkal.\r\nlemak : 0,19 g.\r\nprotein : 1,01 g.\r\nkarbohidrat : 5,7 g.\r\nsodium : 2 mg.\r\nkalium : 230 mg.\r\n', 'Buah terung mengandung zat aktif yang berfungsi untuk kontrasepsi. Selain itu, buh terung dapat mencegah penyakit diabetes dan meningkatkan gairah kerja. Namun, bagi penderita penyakit radang usu/ padang anus dan wanita penderita sakit pembesaran kandungan tidak diperbolehkan makan buah terung karena dapat menimbulkan hal-hal kurang baik. Terung juga buahnya baik sekali untuk obat kencing manis ', 'kindom : Plantae\r\ndivisi:-\r\nkelas : Magnoliopsida\r\nordo : Solanales\r\nfamili : Solanaceae\r\ngenus : Solanum\r\nspesies : Solanum melongena', 'sub_kelas : Asteridae\r\n', NULL, '2019-10-03 10:16:53', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f382b84e05', 'Basis Data', 'Tomat', 'Tomat (Solanum lycopersicum L.)', 'Berasal dari Amerika terutama peru dan equador, kemudian masuk ke erpopa dan penyebarannya ke benua Asia dan dimulai dari filipina melewati jalur Amerika Selatan\r\n(Sunarjono, 2016). Tomat mempunyai nama ilmiah Solanum lycopersicum L., termasuk ke dalam keluarga terong-terongan (Solanaceae), masih satu keluarga dengan cabai, terong ungu, ataupun kentang. Buah tomat termasuk buah buni, berdaging, dan banyak mengandung air terutama pada bagian rongga tempat bijinya. Bentuk buahnya bulat pipih, lunak, dan tidak teratur. Kulit buah berwarna hijau ketika masih mentah, dan akan berubah menjadi merah jika sudah matang ', 'kilojoule : 75kj.\r\nkalori : 18 kkal.\r\nlemak : 0,2 g.\r\nprotein : 0,88 g.\r\nkarbohidrat : 3,92 g.\r\nsodium : 5 mg.\r\nkalium : 237 mg.\r\n', 'Buah tomat baik bagi penderita penyakit wasi (haemorrhoid). Rujak tomat, air tomat dan gula dapat diberikan pada anak-anak, bayi dan orang yang baru menderita sakit. Namun, obat itu tidak dianjurkan untuk yang sering menderita sakit perut. Selain itu, tomat dapat melicinkan kulit terutama muka, sehingga baik untuk perawatn kecantikan', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Solanales\r\nfamili : Solanaceae\r\ngenus : Solanum\r\nspesies : Solanum lycopersicum L', 'sub_kindom : Tracheobionta\r\nsub_divisi : Spermatophyta\r\nsub_kelas : Asteridae\r\n', NULL, '2019-10-03 10:17:52', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f39014cc78', 'Basis Data', 'Tekokak', 'Tekokak (Solanum torvum sp)', 'Tanaman ini berasal dari Asia terutama India dan Birma (Sunarjono, 2016). Tekokak termasuk ke dalam sayuran Solanaceae atau terung-terungan yang dicirikan dengan batang dan daunnya berbulu halus sampai kasar. Bentuk buah tekokak bulat kecil yang berwarna hijau didalamnya terdapat banyak biji yang berwarna cokelat dan ditangkai buahnya terdapat duri-duri kecil yang sedikit tajam. Besar buah tekokak hamper dua kali besar buah leunca dengan garis tengah 1-1,5 cm ', 'Takokak mengandung vitamin A, klorogenin, sisalogenone, solasonin, neoclorogenin,\r\npanicolugenin, jurubine, maupun torvogenin. (Sunarjono, 2016).', 'Tanaman takokak (Solanum torvum sp) memiliki senyawa sterol carpesterol yakni pada buah dan daunnya. Buahdan daunnya mengandung solasodin 0,84% yang merupakan bahan baku hormone seks untuk kontrasepsi ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Solanales\r\nfamili : Solanaceae\r\ngenus : Solanum\r\nspesies : Solanum torvum sp.', 'sub_kindom : Tracheobionta\r\n', NULL, '2019-10-02 15:57:36', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3986ea29c', 'Basis Data', 'Terong Gelatik ', 'Terong Gelatik (Solanum melongena)', 'Berasal dari Asia terutama India dan Birma (Sunarjono, 2016). Terong gelatik termasuk kedalam sayuran Solanaceae. Buah gelatik bentukya bundar dengan warna hijau keputih-putihan dan berwarna ungu. Ditangkainya terdapat duri-duri kecil yang sedikit tajam. Kulit terong gelatik berwarna hijau dengan garis-garis putih dengan daging buah yang berwarna putih dan didalam buah terdapat biji yang berwarna cokelat. Ukuran terong gelatik sebesar bola bekel ', 'kilojoule : 100 kj.\r\nkalori : 24 kkal.\r\nlemak : 0,19 g.\r\nprotein : 1,01 g.\r\nkarbohidrat : 5,7 g.\r\nsodium : 2 mg.\r\nkalium : 230 mg.\r\n', 'Buah terung mengandung zat aktif yang berfungsi untuk kontrasepsi. Selain itu, buh terung dapat mencegah penyakit diabetes dan meningkatkan gairah kerja. Namun, bagi penderita penyakit radang usus/ padang anus dan wanita penderita sakit pembesaran kandungan tidak diperbolehkan makan buah terung karena dapat menimbulkan hal-hal kurang baik. Terung juga buahnya baik sekali untuk obat kencing manis ', 'kindom : Plantae\r\ndivisi:-\r\nkelas : Magnoliopsida\r\nordo : Solanales\r\nfamili : Solanaceae\r\ngenus : Solanum\r\nspesies : Solanum melongena', '', NULL, '2019-10-03 10:17:21', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f39f972ab2', 'Algoritma dan Kompleksitas', '5.3 Perpangkatan dengan DANDC', 'BAB 5. Divide & Conquer (DANDC)', 'https://estudy.unmuhjember.ac.id/pluginfile.php/116782/mod_page/content/3/1.JPG\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116782/mod_page/content/3/2.JPG\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116782/mod_page/content/3/3.JPG\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116782/mod_page/content/3/4.JPG\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116782/mod_page/content/3/5.JPG\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116782/mod_page/content/3/6.JPG\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116782/mod_page/content/3/7.JPG\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116782/mod_page/content/3/8.JPG', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledone\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3a6d15ccf', 'Algoritma dan Kompleksitas', '5.4 Brute Force Vs DANDC', 'BAB 5. Divide & Conquer (DANDC)', 'Kompleksitas algoritma perpangkatan dengan menggunakan metode Brute Force:\r\n  TBF(n) = O(n)\r\n\r\nKompleksitas algoritma perpangkatan dengan menggunakan metode Divide and Conquer\r\n  TDnC(n) = O(log n)\r\n\r\nMetode Divide and Conquer pada algoritma perpangkatan lebih mangkus daripada metode brute force.', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledone\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3ac5e3e01', 'Algoritma dan Kompleksitas', '6.1 Pendahuluan', 'BAB 6. Greedy Algorithm', 'Algoritma greedy berasal dari bahasa inggris, yang berarti tamak atau rakus. Algoritma greedy merupakan jenis algoritma yang menggunakan pendekatan penyelesaian masalah dengan mencari nilai optimum pada setiap langkahnya. Nilai optimum ini dikenal dengan istilah local optimum. Dengan harapan bahwa langkah sisanya mengarah ke solusi optimum global (Global optimum). Pada banyak kasus algoritma greedy tidak akan menghasilkan solusi paling optimal, akan tetapi algoritma greedy biasanya memberikan solusi yang mendekati nilai optimum dalam waktu yang cukup cepat. Oleh karena itu, pada setiap langkah diperlukan keputusan terbaik dalam menentukan pilihan.\r\n\r\n\r\n\r\nAlgoritma greedy merupakan metode yang paling populer untuk memecahkan persoalan optimasi. Hanya ada dua macam persoalan optimasi :\r\n\r\nMaksimasi (Maximization)\r\nMinimasi (Minimization)\r\nContoh persoalan optimasi : Masalah penukaran uang\r\n\r\nDiberikan uang senilai A. Tukar A dengan koin-koin uang yang ada. Berapa jumlah minimum koin yang diperlukan untuk penukaran tersebut?\r\n\r\nPersoalan Minimasi\r\nContoh tersedia banyak koin 1, 5, 10, 25\r\n\r\nUang senilai A = 32 dapat ditukar dengan banyak cara berikut :\r\n32 = 1 + 1 + 1 + .. + 1 (32 koin)\r\n\r\n32 = 5 + 5 + 5 + 5 + 10 + 1 + 1 (7 koin)\r\n\r\n32 = 10 + 10 + 10 + 1 + 1 (5 koin)\r\n\r\ndst\r\n\r\nMinimum :\r\n32 = 25 + 5 + 1 + 1 (4 koin)\r\n\r\nTinjau masalah penukaran uang\r\nStrategi greedy : pada setiap langkah, pilihlah koin dengan nilai terbesar dari himpunan koin yang tersisa.\r\n\r\nMisal A = 32, koin yang tersedia : 1, 5, 10, dan 25\r\nLangkah 1 : pilih satu buah koin bernilai 25 (total = 25)\r\n\r\nLangkah 2 : pilih satu buah koin bernilai 5 (total = 25 + 5 = 30)\r\n\r\nLangkah 3 : pilih dua buah koin bernilai 1 (total = 25 + 5 + 1 = 31)\r\n\r\nSolusi : jumlah koin minimum = 4 (Solusi optimal)', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledone\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3b1aefce1', 'Algoritma dan Kompleksitas', '6.2 Elemen-Elemen Algoritma Greedy', 'BAB 6. Greedy Algorithm', 'Elemen-elemen algoritma greedy :\r\n\r\nHimpunan kandidat, C.\r\nHimpunan solusi, S.\r\nFungsi seleksi (Selection function).\r\nFungsi kelayakan (feasible).\r\nFungsi obyektif.\r\nDengan kata lain :\r\n\r\nAlgoritma greedy melibatkan pencarian sebuah himpunan bagian S dari himpunan bagian C, yang dalam hal ini, S harus memenuhi beberapa kriteria yang ditentukan, yaitu menyatakan suatu solusi dan S dioptimasi oleh fungsi obyektif.\r\n\r\nPada masalah penukaran mata uang :\r\n\r\nHimpunan kandidat : himpunan koin yang merepresentasikan nilai 1, 5, 10, dan 25, paling sedikit mengandung satu koin untuk setiap nilai.\r\nHimpunan solusi : total nilai koin yang dipilih tepat, sama jumlahnya dengan nilai uang yang ditukarkan.\r\nFungsi seleksi : pililhlah nilai koin yang bernilai paling tinggi dari himpunan kandidat yang tersisa.\r\nFungsi layak : memeriksa apakah nilai total dari himpunan koin yang dipilih tidak melebihi jumlah uang akan di tukarkan.\r\nFungsi obyektif : jumlah koin yang digunakan minimum.\r\nContoh kasus yang menggunakan algoritma greedy\r\n\r\nMasalah penukaran Uang\r\n\r\nNilai uang yang ditukar = A\r\n\r\nHimpunan koin (multiset) : { d1,d2,,dn }\r\n\r\nHimpunan solusi : X = { X1,X2,,Xn }, Xi = 1 jika di dipilih, Xi = 0 jika di tidak dipilih', '-', '-', 'kindom : Plantae\ndivisi:s\nkelas : Dicotyledone\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3edb63e57', 'Algoritma dan Kompleksitas', '4.1 Definisi dan Karakteristik Algoritma Brute Force', 'BAB 4. Brute Force Algorithm', 'Definisi Brute Force\r\n\r\nBrute force adalah sebuah pendekatan yang langsung (straightforward) untuk memecahkan suatu masalah, biasanya didasarkan pada pernyataan masalah (problem statement) dan definisi konsep yang dilibatkan.\r\nAlgoritma brute force memecahkan masalah dengan sangat sederhana, langsung dan dengan cara yang jelas (obvious way).\r\nKarakteristik Algoritma Brute Force\r\n\r\nAlgoritma brute force umumnya tidak cerdas dan tidak mangkus, karena ia membutuhkan jumlah langkah yang besar dalam penyelesaiannya. Kadang-kadang algoritma brute force disebut juga algoritma naif (nave algorithm).\r\nAlgoritma brute force seringkali merupakan pilihan yang kurang disukai karena ketidakmangkusannya itu, tetapi dengan mencari pola-pola yang mendasar, keteraturan, atau trik-trik khusus, biasanya akan membantu kita menemukan algoritma yang lebih cerdas dan lebih mangkus.\r\nUntuk masalah yang ukurannya kecil, kesederhanaan brute force biasanya lebih diperhitungkan daripada ketidakmangkusannya.  Algoritma brute force sering digunakan sebagai basis bila membandingkan beberapa alternatif algoritma yang mangkus.\r\nAlgoritma brute force seringkali lebih mudah diimplementasikan daripada algoritma yang lebih canggih, dan karena kesederhanaannya, kadang-kadang algoritma brute force dapat lebih mangkus (ditinjau dari segi implementasi).', '-', '-', 'kindom : Plantae\ndivisi:-\nkelas : Magnoliopsida\nordo : Rhamnales\nfamili : Vitaceae\ngenus : Vitis\nspesies : Vitis vinifera', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3f2fb2775', 'Algoritma dan Kompleksitas', '4.2 Contoh-contoh Brute Force', 'BAB 4. Brute Force Algorithm', 'Berikut ini adalah contoh-contoh Algoritma Brute Force :\r\n\r\n1. Sequential Search\r\n\r\nSequential Search adalah teknik pencarian data dimana data dicari secara urut dari depan ke belakang atau dari awal sampai akhir.\r\n\r\n2. Bubble Sort\r\n\r\nBubble Sort adalah salah satu algoritma untuk sorting data, atau kata lainnya mengurutkan data dari yang terbesar ke yang terkecil atau sebaliknya (Ascending atau Descending).\r\n\r\nBubble sort (metode gelembung) adalah metode/algoritma pengurutan dengan dengan cara melakukan penukaran data dengan tepat disebelahnya secara terus menerus sampai bisa dipastikan dalam satu iterasi tertentu tidak ada lagi perubahan. Jika tidak ada perubahan berarti data sudah terurut. Disebut pengurutan gelembung karena masing-masing kunci akan dengan lambat menggelembung ke posisinya yang tepat.\r\n\r\n3. Selection Sort\r\n\r\nPengertian dari selection sort adalah mencari elemen yang tepat untuk diletakkan di posisi yang telah diketahui, dan meletakkannya di posisi tersebut setelah data tersebut ditemukan, Selection Sort Membandingkan elemen yang sekarang dengan elemen yang berikutnya sampai dengan elemen yang terakhir. Jika ditemukan elemen lain yang lebih kecil dari elemen sekarang  maka dicatat posisinya dan kemudian ditukar.\r\n\r\n4. Analisia Polinom\r\n\r\nPolinomial atau suku banyak ( juga ditulis suku banyak ) adalah pernyataan matematika yang melibatkan jumlahan perkalian pangkat dalam satu atau lebih variabel dengan koefisien.\r\n\r\n5. String Matching\r\n\r\nAlgoritma string matching (pencocokan string) adalah algoritma untuk melakukan pencarian semua kemunculan string pendek (pattern) yang muncul dalam teks. Pettern yaitu string dengan panjang m karakter ( m < n ). Teks (text) yaitu long string yang panjangnya n karakter. Contoh implementasi String matching adala pencocokan string pada Microsoft word, editor atau pencocokan website dengan memasukkan kata kunci sebagaimana yang telah diterapkan pada search engine seperti yahoo, tau Google.', '-', '-', 'kindom : Plantae\ndivisi:-\nkelas : Magnoliopsida\nordo : Rhamnales\nfamili : Vitaceae\ngenus : Vitis\nspesies : Vitis vinifera', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3f7212810', 'Algoritma dan Kompleksitas', '5.1 Definisi dan Bentuk Umum Metode DANDC', 'BAB 5. Divide & Conquer (DANDC)', 'Berikut ini definisi dari Divide, Conquer, dan Combine\r\n\r\nDivide:  membagi masalah menjadi beberapa upa-masalah yang memiliki kemiripan dengan masalah semula namun berukuran lebih kecil (idealnya berukuran hampir sama),\r\nConquer: memecahkan (menyelesaikan) masing-masing upa-masalah (secara  rekursif), dan\r\nCombine: mengabungkan solusi masing-masing upa-masalah sehingga membentuk solusi masalah semula.\r\nBerikut ini adalah bentuk umum metode DANDC\r\n\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116778/mod_page/content/2/22.JPG\r\n\r\nSedangkan di bawah ini adalah skema umum Algoritma Divide and Conquer (DANDC)\r\n\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116778/mod_page/content/2/33.JPG\r\n\r\nJika pembagian selalu menghasilkan dua upa-masalah yang berukuran sama:\r\n\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116778/mod_page/content/2/44.JPG', '-', '-', 'kindom : Plantae\ndivisi:-\nkelas : Magnoliopsida\nordo : Rhamnales\nfamili : Vitaceae\ngenus : Vitis\nspesies : Vitis vinifera', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3f8fa101c', 'Algoritma dan Kompleksitas', '3.1 Model Perhitungan Kebutuhan Waktu/Ruang', 'BAB 3. Algorithm Complexity', '(i) Operasi pengisian nilai (jumlah0,  k1, jumlahjumlah+ak, kk+1, dan r  jumlah/n)\r\n\r\n         Jumlah seluruh operasi pengisian nilai adalah\r\n\r\n                   t1 = 1 + 1 + n + n + 1 = 3 + 2n\r\n\r\n \r\n\r\n(ii)   Operasi penjumlahan (jumlah+ak, dan k+1)\r\n\r\n        Jumlah seluruh operasi penjumlahan adalah\r\n\r\n                   t2 =  n + n = 2n \r\n\r\n \r\n\r\n(iii)  Operasi pembagian (jumlah/n)\r\n\r\n        Jumlah seluruh operasi pembagian adalah\r\n\r\n          t3 = 1\r\n\r\n\r\n\r\nTotal kebutuhan waktu algoritma Hitung Rerata:\r\n\r\n \r\n\r\n          t = t1 + t2 + t3 = (3 + 2n)a + 2nb + c  detik                                           \r\n\r\n                     \r\n\r\nModel perhitungan kebutuhan waktu seperti di atas kurang dapat diterima:\r\nDalam praktek kita tidak mempunyai informasi berapa waktu sesungguhnya untuk melaksanakan suatu operasi tertentu\r\nKomputer dengan arsitektur yang berbeda akan berbeda pula lama waktu untuk setiap jenis operasinya.\r\nSelain bergantung pada komputer, kebutuhan waktu sebuah program juga ditentukan oleh compiler bahasa yang digunakan.\r\nModel abstrak pengukuran waktu/ruang harus independen  dari pertimbangan mesin dan compiler apapun.\r\nBesaran yang dipakai untuk menerangkan model abstrak pengukuran waktu/ruang ini adalah kompleksitas algoritma.\r\nAda dua macam kompleksitas algoritma, yaitu kompleksitas waktu dan kompleksitas ruang.\r\nKompleksitas waktu, T(n), diukur dari jumlah tahapan komputasi yang dibutuhkan untuk menjalankan algoritma sebagai fungsi dari ukuran masukan n.\r\nKompleksitas ruang, S(n), diukur dari memori yang digunakan oleh struktur data yang terdapat di dalam algoritma sebagai fungsi dari ukuran masukan n.\r\nDengan menggunakan besaran kompleksitas waktu/ruang algoritma, kita dapat menentukan laju peningkatan waktu (ruang) yang diperlukan algoritma dengan meningkatnya ukuran masukan n.', 'kilojoule : 143  kj\r\nkalori : 32 kkal.\r\nlemak : 0,1 g.\r\nprotein : 0,63 g.\r\nkarbohidra : 8,08 g.\r\nkalium : 139 mg.', 'Fungsi serat pada jeruk sangat penting, antara\r\nlain membantu proses pencernaan, menurunkan\r\nkadar kolesterol dalam darah dan juga\r\nmenurunkan resiko penyakit jantung.\r\nMenghambat  terjadinya  kanker.\r\nUntuk menyembuhkan gangguan pendarahan\r\nkarena wasir, demam, mengurangi keasaman\r\ndarah, memperlancar pembentukan air seni, dan\r\nmengatur pengeluaran cairan empedu.\r\nMeningkatkan kekebalan tubuh, menurunkan\r\ntekanan darah, untuk kesehatan tulang, melawan\r\npenuaan dini, menurunkan berat badan, sampai\r\nuntuk kesehatan gigi dan mulut.', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotyledonae\r\nordo : Rutales\r\nfamili : Rutaceae\r\ngenus : Citrus\r\nspesies : Citrus maxima, Citrus sinensis', 'sub_divisi : Angiospermae\r\n', NULL, '2019-10-03 10:25:46', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f43c8c3a2a', 'Algoritma dan Kompleksitas', '6.3 Penyelesaian dengan Algoritma Greedy', 'BAB 6. Greedy Algorithm', 'Penyelesaian dengan Algoritma Greedy:\r\n\r\nMasukkan objek satu per satu ke dalam knapsack. Sekali objek dimasukkan ke dalam knapsack, objek tersebut tidak bisa dikeluarkan lagi.\r\nTerdapat beberapa strategi greedy yang heuristik yang dapat digunakan untuk memilih objek yang akan dimasukkan ke dalam knapsack.\r\nBerikut ini 3 macam penyelesaian Algoritma Greedy:\r\n\r\n1.Greedy by profit.\r\nPada setiap langkah, pilih objek yang mempunyai keuntungan terbesar.\r\nMencoba memaksimumkan keuntungan dengan memilih objek yang paling menguntungkan terlebih dahulu.\r\n2.Greedy by weight.\r\nPada setiap langkah, pilih objek yang mempunyai berat teringan.\r\nMencoba memaksimumkan keuntungan dengan dengan memasukkan sebanyak mungkin objek ke dalam knapsack.\r\n3.Greedy by density.\r\nPada setiap langkah, knapsack diisi dengan objek yang mempunyai pi /wi  terbesar. \r\nMencoba memaksimumkan keuntungan dengan memilih objek yang mempunyai keuntungan per unit berat terbesar.\r\n\r\n\r\nPemilihan objek berdasarkan salah satu dari ketiga strategi di atas tidak menjamin akan memberikan solusi optimal.', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledonae\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f4406b6d41', 'Algoritma dan Kompleksitas', '7.1 Definisi Program Dinamis', 'BAB 7. Dynamic Programming', '1. Definisi\r\n\r\nProgram Dinamis (dynamic programming) adalah metode pemecahan masalah dengan cara menguraikan solusi menjadi sekumpulan langkah (step) atau tahapan (stage) sedemikian sehingga solusi dari persoalan dapat dipandang dari serangkaian keputusan  yang saling berkaitan. \r\n\r\nPada penyelesaian persoalan dengan metode ini akan terdapat sejumlah berhingga pilihan yang mungkin, solusi pada setiap tahap dibangun dari hasil solusi tahap sebelumnya, kita menggunakan persyaratan optimasi dan kendala untuk membatasi sejumlah pilihan yang harus dipertimbangkan pada suatu tahap.\r\n\r\n2. Prinsip Optimalitas\r\n\r\nPada program dinamis, rangkaian keputusan yang optimal dibuat dengan menggunakan Prinsip Optimalitas.\r\nPrinsip Optimalitas: jika solusi total optimal, maka bagian solusi sampai tahap ke-k juga optimal.\r\nPrinsip optimalitas berarti bahwa jika kita bekerja dari tahap k ke tahap k + 1, kita dapat menggunakan hasil optimal dari tahap k tanpa harus kembali ke tahap awal.\r\nOngkos pada tahap k +1 =(ongkos yang dihasilkan pada tahap k )  + (ongkos dari tahap k ke tahap k + 1)\r\nDengan prinsip optimalitas ini dijamin bahwa pengambilan keputusan pada suatu tahap adalah keputusan yang benar untuk tahap-tahap selanjutnya.\r\nPada metode greedy hanya satu rangkaian keputusan yang pernah dihasilkan, sedangkan pada metode program dinamis lebih dari satu rangkaian keputusan. Hanya rangkaian keputusan yang memenuhi prinsip optimalitas yang akan dihasilkan.', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledonae\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f4443c4605', 'Algoritma dan Kompleksitas', '7.2 Karakteristik Program Dinamis', 'BAB 7. Dynamic Programming', 'Karakteristik Persoalan Program Dinamis\r\n\r\nPersoalan dapat dibagi menjadi beberapa tahap (stage), yang pada setiap tahap hanya diambil satu keputusan.\r\nMasing-masing tahap terdiri dari sejumlah status (state) yang berhubungan dengan tahap tersebut. Secara umum, status merupakan bermacam kemungkinan masukan yang ada pada tahap tersebut.\r\nHasil dari keputusan yang diambil pada setiap tahap ditransformasikan dari status yang bersangkutan ke status berikutnya pada tahap berikutnya.\r\nOngkos (cost) pada suatu tahap meningkat secara teratur (steadily) dengan bertambahnya jumlah tahapan.\r\nOngkos pada suatu tahap bergantung pada ongkos tahap-tahap yang sudah berjalan dan ongkos pada tahap tersebut.\r\nKeputusan terbaik pada suatu tahap bersifat independen terhadap keputusan yang dilakukan pada tahap sebelumnya.\r\nAdanya hubungan rekursif yang mengidentifikasikan keputusan terbaik untuk setiap status pada tahap k memberikan keputusan terbaik untuk setiap status pada tahap k + 1.\r\nPrinsip optimalitas berlaku pada persoalan tersebut.', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledonae\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('2019-10-02-5d9412c389e2e', 'Algoritma dan Kompleksitas', '3.3 Pengelompokan Algoritma Berdasarkan Notasi O-Besar', 'BAB 3. Algorithm Complexity', 'Urutan spektrum kompleksitas waktu algoritma adalah:\r\n\r\nhttps://estudy.unmuhjember.ac.id/pluginfile.php/116754/mod_page/content/3/Capture5.JPG\r\n\r\nPenjelasan masing-masing kelompok algoritma adalah sebagai berikut:\r\n\r\nKompleksitas O(1) berarti waktu pelaksanaan algoritma adalah tetap, tidak bergantung pada ukuran masukan.\r\nO(log n) adalah kompleksitas waktu logaritmik berarti laju pertumbuhan waktunya berjalan lebih lambat daripada pertumbuhan n. Algoritma yang termasuk kelompok ini adalah algoritma yang memecahkan persoalan besar dengan mentransformasikannya menjadi beberapa persoalan yang lebih kecil yang berukuran sama (misalnya algoritma pencarian_biner). Di sini basis algoritma tidak terlalu penting sebab bila n dinaikkan dua kali semula, misalnya, log n meningkat  sebesar sejumlah tetapan.\r\n\r\n\r\nO(n) adalah algoritma yang waktu pelaksanaannya lanjar umumnya terdapat pada kasus yang setiap elemen masukannya dikenai proses yang sama, misalnya algoritma pencarian_beruntun. Bila n dijadikan dua kali semula, maka waktu pelaksanaan algoritma juga dua kali semula.\r\n\r\n\r\nO(n log n) adalah waktu pelaksanaan yang n log n terdapat pada algoritma yang memecahkan persoalan menjadi beberapa persoalan yang lebih kecil,  menyelesaikan tiap persoalan secara independen, dan menggabung solusi masing-masing persoalan. Algoritma yang diselesaikan dengan teknik bagi dan gabung mempunyai kompleksitas asimptotik jenis ini. Bila n = 1000, maka n log n mungkin 20.000. Bila n dijadikan dua kali semual, maka n log n menjadi dua kali semula (tetapi tidak terlalu banyak)\r\n\r\n\r\nO(n2) adalah algoritma yang waktu pelaksanaannya kuadratik hanya praktis digunakan untuk persoalana yang berukuran kecil. Umumnya algoritma yang termasuk kelompok ini memproses setiap masukan dalam dua buah kalang bersarang, misalnya pada algoritma urut_maks. Bila n = 1000, maka waktu pelaksanaan algoritma adalah 1.000.000. Bila n dinaikkan menjadi dua kali semula, maka waktu pelaksanaan algoritma meningkat menjadi empat kali semula.\r\n\r\n\r\nO(n3) adalah seperti halnya algoritma kuadratik, algoritma kubik memproses setiap masukan dalam tiga buah kalang bersarang, misalnya algoritma perkalian matriks. Bila n = 100, maka waktu pelaksanaan algoritma adalah 1.000.000. Bila n dinaikkan menjadi dua kali semula, waktu pelaksanan algoritma meningkat menjadi delapan kali semula.\r\n\r\nO(2n) adalah algoritma yang tergolong kelompok ini mencari solusi persoalan secara \"brute force\", misalnya pada algoritma mencari sirkuit Hamilton (lihat Bab 9). Bila n = 20, waktu pelaksanaan algoritma adalah 1.000.000. Bila n dijadikan dua kali semula, waktu pelaksanaan menjadi kuadrat kali semula!\r\n\r\n\r\nO(n!), seperti halnya pada algoritma eksponensial, algoritma jenis ini memproses setiap masukan dan menghubungkannya dengan n - 1 masukan lainnya, misalnya algoritma Persoalan Pedagang Keliling (Travelling Salesperson Problem - lihat bab 9). Bila n = 5, maka waktu pelaksanaan algoritma adalah 120. Bila n dijadikan dua kali semula, maka waktu pelaksanaan algoritma menjadi faktorial dari 2n.', 'kilojoule : 393  kj\r\nkalori : 94 kkal.\r\nlemak : 0,29 g.\r\nprotein : 2,06 g.\r\nkarbohidrat : 23,64 g.\r\nsodium : 9 mg.\r\nkalium : 247 mg.', 'Sebagai antioksidan.\r\nMelindungi tubuh dari    penyakit jantung.\r\nMenyeimbangkan air dalam tubuh.\r\nMengurangi gejala rematik dan radang sendi,\r\nserta membantu menghilangkan asam dari sendi.\r\nMembantu melawan kelemahan otot.\r\nMenjaga  kulit,  kesehatan  rambut,  dan \r\nmeningkatkan  fungsi  mata.\r\nDapat mengontrol tekanan darah, membantu\r\nmenormalkan fungsi pencernaan,\r\nmenyembuhkansembelit, diare, dan disentri .', 'Kingdom 	: Plantae (Tumbuhan).\r\nSub Kingdom 	: Tracheobionta (Tumbuhan berpembulu).\r\nSuper Divisi 	: Spermatophyta (Menghasilkan biji).\r\nDivisi 		: Magnoliopsida (Tumbuhan berbunga).\r\nKelas 		: Magnoliopsida (Berkeping dua/ dikotil).\r\nSub Kelas 	: Magnoliidae.\r\nOrdo 		: Magnoliales.\r\nFamili		: Annonaceae.\r\nGenus 		: Annona.\r\nSpesies 	: Annona squamosa L. (Sumber: Sunarjono, 2008).\r\n', '', NULL, '2019-10-03 10:24:32', '2019-10-02 03:00:19', 1, 1),
('2019-10-02-5d9413a0f11d6', 'Algoritma dan Kompleksitas', '3.2 Kompleksitas Waktu', 'BAB 3. Algorithm Complexity', 'Contoh 2. Tinjau algoritma menghitung rerata pada Contoh 1. Operasi yang mendasar pada algoritma tersebut adalah operasi penjumlahan elemen-elemen ak (yaitu jumlahjumlah+ak), \r\n\r\nKompleksitas waktu Hitung Rerata adalah  T(n) = n.\r\n\r\n\r\n\r\n\r\nContoh 3. Algoritma untuk mencari elemen terbesar di dalam sebuah larik (array) yang berukuran n elemen.\r\n\r\nKompleksitas waktu algoritma dihitung berdasarkan jumlah operasi perbandingan elemen larik (A[i] > maks).\r\n\r\n \r\n\r\nKompleksitas waktu CariElemenTerbesar :  T(n) = n  1.                                                                                                \r\n\r\n \r\n\r\nKompleksitas waktu dibedakan atas tiga macam :\r\n\r\n1. Tmax(n) : kompleksitas waktu untuk kasus terburuk (worst case), atau kebutuhan waktu maksimum.\r\n\r\n2. Tmin(n) : kompleksitas waktu untuk kasus terbaik (best case), atau kebutuhan waktu minimum.\r\n\r\n3. Tavg(n): kompleksitas waktu untuk kasus rata-rata (average case), atau kebutuhan waktu secara rata-rata', 'kilojoule :  431 kj\r\nkalori : 103 kkal.\r\nlemak : 0,23 g.\r\nprotein : 1,07 g.\r\nkarbohidrat : 27,12 g.\r\nsodium : 2 mg.\r\nkalium : 490 mg.', 'Buah sukun mengandungkarbohidarat, niasin,\r\nvitamin C, riboflavin, kalium, tiamin, kalsium,\r\nnatrium, dan besi.\r\nAsam aminoesensial yang terkandung pada buah\r\nbermanfaat untuk pencernaan, memperkuat gigi,\r\ntulang,mengobati penyakit ginjal, liver, dan\r\ndiabetes.', 'Kingdom 	: Plantae (Tumbuhan).\r\nSub Kingdom 	: Trachebionta (Tumbuhan berpembuluh).\r\nSuper Divisi 	: Spermatophyta (Menghasilkan biji).\r\nDivisi 		: Magnoliophyta (Tumbuhan berbunga).\r\nKelas 		: Liliopsida (Berkeping satu/ monokotil).\r\nSub Kelas 	: Commelinidae.\r\nOrdo 		: Zingiberales.\r\nFamili 		: Musaceae (suku pisangpisangan).\r\nGenus 		: Musa.\r\nSpesies	: Artocarpus communis (Sumber: Sunarjono, 2006).', '', NULL, '2023-09-26 11:32:06', '2019-10-02 03:04:00', 1, 1),
('2019-10-02-5d94156258d61', 'Algoritma dan Kompleksitas', '1.5 Tipe-tipe Permasalahan Penting', 'BAB 1. Introduction', 'Ada 7 permasalahan penting dalam algoritma yaitu:\r\n\r\n1. Sorting\r\n\r\nmenyususn ulang hal-hal yang terdapat pada daftar dengan urutan tertentu\r\n\r\n Jika ada records, kita perlu sebuah key\r\n\r\n Terdapat beberapa lusin algoritma sorting\r\n\r\n Dua properti algortima sorting :\r\n\r\n   Stable: Mempertahankan urutan relative sembarang dua   elemen input yang sama\r\n\r\n   In Place: tidak memerlukan memori ekstra kecuali ,   mungkin beberapa unti memori\r\n\r\n\r\n\r\n2. Searching\r\n\r\nmenemukan suatu nilai dari sekumpulan nilai yang ada.\r\n\r\n Jangkauan algoritma searching :\r\n\r\nPencarian sekuensial hingga binary (sangat efisien, namun terbatas) dan algoritma didasarkan pada representasi kumpulan nilai tersebut sehingga memungkinkan pencarian yang lebih baik.\r\n\r\n Tantangan :\r\n\r\nKumpulan data yang sangat besar\r\n\r\n\r\n\r\n3. String processing\r\n\r\nurutan karakter alphabet\r\n\r\n Minat Khusus : text strings, binary strings dan lain-lain\r\n\r\n Problem yang khusus : pencocokan string pencarian suatu kata dalam text\r\n\r\n\r\n\r\n4. Graph problems\r\n\r\nAlgoritma graph dasar : graph traversal, shortest-path, sorting topologik pada graph dengan ujung berarah. Beberapa masalah sangat sulit diselesaika dengan cara komputasi hanya beberapa contoh yang dapat  diselesaikan dalam waktu yang dapat diterima.\r\n\r\nContoh :\r\n\r\nTSP (Traveling Salesman Problem)\r\n\r\nGCP(Graph Coloring Problem) Pewarnaan\r\n\r\nGraph\r\n\r\n\r\n\r\n5. Combinatorial problems\r\n\r\nMasalah : Menemukan suatu objek kombinatorik seperti permutasi, kombinasi atau subset yang memenuhi  atasan tertentu dan memiliki properti yang diinginkan.\r\n\r\n Problem yang paling sulit :\r\n\r\nSejumlah objek kombinatorik tertentu tumbuh dengan cepat seiring peningkatan ukuran masalah. Tidak diketahui algoritma eksak untuk menyelesaikan masalah tersebut.\r\n\r\n Salah satu contohnya TSP dan GCP.\r\n\r\n\r\n\r\n6. Geometric problems\r\n\r\nBerkaitan dengan objek geometrik: titik, garis, poligon dan lain-lain\r\n\r\nYunani Kuno: membangun geometrik sederhana contohnya segitiga, lingkaran dan lain-lain\r\nMasa kini: aplikasi komputer  grafik, robot\r\nMasalah klasik: Problem closest pair diberikan titik pada suatu bidang, dan temukan pasangan terdekatnya\r\nConvex hull: temukan poligon cembung terkecil yang melibatkan semua titik yang telah ditentukan\r\n\r\n\r\n7. Numerical problems\r\n\r\nBerkaitan dengan objek matematis yang memiliki sifat kontinyu memecahkan persamaan dan sistem persamaan, menghitung integral tak hingga dan lain-lain\r\nMayoritas permasalahan diatas dapat dipecahkan dengan perkiraan.\r\nPerubahan fokus komputasi industri : analisis numerik (pada industri dan ilmu pengetahuan) menuju aplikasi bisnis (penyimpanan informasi, transportasi melalui jaringan dan presentasi kepada pengguna)', 'kilojoule :  71 kj\r\nkalori : 17 kkal.\r\nlemak : 0,13 g.\r\nprotein : 0,4 g.\r\nkarbohidrat : 4,21 g.\r\nsodium : 5 mg.\r\nkalium : 63 mg.', 'Untuk obat penenang juga berkhasiat\r\nmenghilangkan rasa nyeri (analgesik) dan\r\nmemperkuat   paru.\r\nSebagai anti radang, penenang (sedatif), peluruh\r\nkencing (diuretik), serta bersifat membersihkan\r\npanas dan racun.', 'Kingdom	 : Plantae .\r\nDivisi		 : Spermatophyta .\r\nSub divisi	 : Angiospermae .\r\nKelas		 : Dicotyledoneae .\r\nBangsa 	 : Parietales .\r\nSuku		 : Passifloraceae .\r\nMarga		 : Passitlora .\r\nJenis/ Spesies	 : Passiflora edulis (Sumber: www.petanihebat.com,2018).\r\n\r\n', '', NULL, '2019-10-03 10:28:22', '2019-10-02 03:11:30', 1, 1),
('2019-10-02-5d9416c8dec33', 'Algoritma dan Kompleksitas', '1.3 Prosedur untuk Mendesain dan Menganalisis Algoritma', 'BAB 1. Introduction', 'Berikut ini ada 9 prosedur untuk merancang dan menganalisis algoritma yaitu:\r\n\r\nMendefinisikan masalah: Masalah yang ingin dipecahkan harus jelas lingkupnya.\r\nMembuat model: model (bentuk) matematis yang dapat digunakan untuk memecahkan masalah, misalnya apakah harus dilakukan pengurutan terhadap data, apakah menggunakan perhitungan kombinatorik dan sebagainya.\r\nMerancang algoritma (flowchart/pseudocode): Apa maksudnya, bagaimana rincian prosesnya, apa keluarannya.\r\nMenulis program: Ubah algoritma menjadi program (source code) dalam bahasa pemrograman tertentu.\r\nMengubah source code menjadi executable code melalui proses compiling.\r\nMemeriksa hasil compiling, jika salah maka kembali ke tahap empat.\r\nMenjalankan program (run) untuk diuji kebenarannya dengan menggunakan berbagai data.\r\nMemperbaiki kesalahan (debugging dan testing): Apabila hasilnya salah, kesalahan mungkin terjadi saat konversi rancangan algoritma menjadi program, atau salah rancang algoritma, atau salah menentukan model, atau salah mendefinisikan masalah. Ulangi langkah yang sesuai.\r\nMendokumentasi program bila sudah benar.', 'kilojoule :  305 kj\r\nkalori : 73 kkal.\r\nlemak : 0,58 g.\r\nprotein : 0,41 g.\r\nkarbohidrat : 17,91 g.\r\nsodium : 7 mg.\r\nkalium : 48 mg.', 'Memperbaiki sel-sel yang rusak karena terpapar\r\nradikal bebas, memperlambat penuaan,\r\nmencegah penyakit degeneratif.\r\nMemiliki kandungan antibakteri dan antijamur\r\nyang memperkuat daya tahan tubuh', 'Kingdom	: plantae.\r\nDivisi		: spermatophyta.\r\nSub divisi 	: angiospermae.\r\nKelas		: guttiferae.\r\nGenus		: garcinia.\r\nSpesies	: garcinia mangostana L (Sumber: www.ristek.go.id,2018).\r\n\r\n', '', NULL, '2019-10-03 10:31:10', '2019-10-02 03:17:28', 1, 1),
('2019-10-02-5d94193012dbc', 'Algoritma dan Kompleksitas', '1.1 Asal Usul Algoritma', 'BAB 1. Introduction', 'Kata algoritma berasal dari nama Abu Jafat Mohammed Ibn Musa al-Khowarizmi, seorang ilmuan Persia yang menulis buku berjudul Kitab al jabr wal-muqabala (rules of restoration and reduction) sekitar tahun 825. Pada tahun 1950 istilah algorithm selalu diasosiasikan dengan Euclids algorithm, yaitu suatu proses yang menjelaskan cara mencari bilangan pembagi terbesar untuk dua buah bilangan. Dalam Merriam-Websters Collegiet Dictionary istilah algorithm diartikan sebagai prosedur langkah demi langkah untuk memecahkan masalah atau Penyelesaian suatu tugas khususnya dengan menggunakan bantuan komputer.\r\nDefinisi:\r\nAlgoritma adalah deretan langkah-langkah komputasi yang mentransformasikan data masukan menjadi keluaran\r\nAlgoritma adalah deretan instruksi yang jelas untuk memecahkan masalah, yaitu untuk memperoleh keluaran yang diinginkan dari suatu masukan dalam jumlah waktu yang terbatas.', 'kilojoule :  142 kj\r\nkalori : 34 kkal.\r\nlemak : 0,19 g.\r\nprotein : 0,84 g.\r\nkarbohidrat : 8,16 g.\r\nsodium : 16 mg.\r\nkalium : 267 mg.', 'Baik bagi pertumbuhan gigi, tulang dan mata\r\nMampu menurunkan resiko penyakit jantung,\r\npencegah penyakit gula darah kandungan air dan\r\ngula alami pada buah melon mampu mencegah\r\npenyakit diabetes.\r\nMembantu pencegah kanker dan dapat membuat\r\nmata sehat serta melancarkan proses pencernaan.', 'Kingdom 	: Plantae.\r\nDivisi		: Spermatophyta.\r\nSubdivisi 	: Angiospermae.\r\nKelas 		: Dicotyledonae.\r\nOrdo 		: Cucurbitales.\r\nFamily 	: Cucurbitaceae.\r\nGenus 		: Cucumis.\r\nSpesies 	: Cucumis melo L. (Sumber: www.ristek.go.id,2018).\r\n', '', NULL, '2019-10-04 01:13:29', '2019-10-02 03:27:44', 1, 1),
('2019-10-02-5d9419cd8c446', 'Algoritma dan Kompleksitas', '2.1 Algoritma Rekursif', 'BAB 2. Recursive and Non Recursive Algorithm', '1. Definisi\r\n\r\nSuatu entitas yang disebut rekursif jika dalam pendefenisian entitas tersebut terkandung entitas tersebut. Dalam artian sebuah rekursif merupakan suatu perulangan yang menggunakan metode memanggil dirinya sendiri dalam sebuah algoritma pemrograman. Jadi metode rekursif, melakukan siklus tanpa menggunakan sintax perulangan seperti, (for, while do, repeat untill, dan sejenisnya).\r\n\r\nUntuk mengenal suatu program yang mengandung nilai rekursif atau tidak, hanya melihat dari kondisi paramater. Jika program utama tidak memiliki parameter, tidak mungkin bersifat rekursif. Selain itu prosedur dan fungsi juga bisa bersifat rekursif. Contoh kasus yang biasa menggunakan rekursif adalah faktorial.\r\n\r\n2. Fungsi Rekursif\r\n\r\nFungsi rekursif dalam pemrograman merupakan fungsi yang memanggil dirinya sendiri. Fungsi rekursif seperti halnya perulangan. Karena tingkah lakunya yang mengulang-ulang setiap pemanggilan dirinya.\r\n\r\n3. Kelebihan Algoritma Rekursif\r\n\r\nSolusi sangatlah mudah\r\nDapat melakukan perulangan dengan batasan fungsi\r\nDapat memecahkan tahapan yang sulit dengan tahapan yang mudah dan efisien\r\n4. Kekurangan Algoritma Rekursif\r\n\r\nTidak bisa melakukan nested loop atau looping bersarang\r\nProses agak berbelit-belit karena terdapat pemangilan fungsi yang berulang-ulang dan pemanggilan data yang ditumpuk\r\n', 'kilojoule :  29 kj\r\nkalori : 7 kkal.\r\nlemak : 0,02 g.\r\nprotein : 0,06 g.\r\nkarbohidrat : 1,79 g.\r\nsodium : 1 mg.\r\nkalium : 4 mg.', 'Meningkatkan kualitas sperma.\r\nMencegah penyakit jantung.\r\nMenjaga fungsi ginjal.\r\nMembentuk dan menguatkan tulang.\r\nMengatasi hipertensi.\r\nMencegah kanker.', 'Kingdom	: Plantae (Tumbuhan).\r\nSubkingdom	: Tracheobionta (Tumbuhan berpembuluh).\r\nSuper Divisi	: Spermatophyta (Menghasilkan biji).\r\nDivisi		: Magnoliophyta (Tumbuhan berbunga).\r\nKelas		: Magnoliopsida (berkeping dua/dikotil).\r\nSub Kelas	: Rosidae.\r\nOrdo		: Sapindales.\r\nFamili		: Sapindaceae.\r\nGenus		: Nephelium.\r\nSpesies	: Nephelium lappaceum L (Sumber, www.petanihebat.com, 2018).\r\n', '', NULL, '2019-10-03 10:27:34', '2019-10-02 03:30:21', 1, 1),
('2019-10-02-5d941a68f256d', 'Algoritma dan Kompleksitas', '2.2 Algoritma Non-Rekursif', 'BAB 2. Recursive and Non Recursive Algorithm', '1. Definisi\r\n\r\nAlgoritma non-rekursif adalah algoritma yang dalam penyelesaiannya memanfaatkan stack.\r\n\r\n2. Langkah-langkah umum untuk menganalisis efisiensi waktu algoritma\r\n\r\nTentukan parameter yang mengindikasikan ukuran input\r\nidentifikasi basic operation algoritma\r\ntentukan apakah untuk ukuran input yang sama banyaknya eksekusi basic operation bisa berbeda\r\ntentukan rumus sigma yang menunjukkan berapa kali basic operation dieksekusi\r\nselesaikan rumus sigma untuk menghitung banyaknya eksekusi basic operation\r\n3. Efisiensi waktu algoritma non-rekursif\r\n\r\nTentukan parameter n yang menunjukkan ukuran input\r\n\r\nTentukan operasi dasar algoritma (loop terdalam)\r\n\r\nPeriksa apakah operasi dasar dijalankan hanya bergantung pada ukuran input. Jika tergantung bukan hanya pada ukuran input saja, kasus terburuk, rata-rata, dan jika perlu efisiensi kasus terbaik harus diselidiki secara terpisah.\r\n\r\nTentukan rumus sigma yang menunjukkan berapa kali operasi dasar dijalankan -> C(n)\r\n\r\nSelesaikan rumus sigma untuk menghitung banyaknya operasi dasar dijalankan\r\n\r\n', 'kilojoule : 285  kj\r\nkalori : 68 kkal.\r\nlemak : 0,43 g.\r\nprotein : 0,85 g.\r\nkarbohidrat : 17,06 g.\r\nsodium : 1 mg.\r\nkalium : 196 mg.', 'Menjaga sistem pencernaan.\r\nMenjaga tulang.\r\nMengobati sakit perut.\r\nMenjaga kesehatan gusi dan mulut.', 'Kerajaan	: Plantae.\r\nDivisi		: Magnoliophyta.\r\nKelas		: Magnoliopsida.\r\nBangsa		: Sapindales .\r\nSuku		: Meliaceae.\r\nMarga		: Lansium.\r\nJenis		: Lansium domesticum Corr var duku Hasskl (Sunarti, 1987).\r\n', '', NULL, '2019-10-03 10:26:42', '2019-10-02 03:32:56', 1, 1),
('2019-10-02-5d941b819c8ac', 'Algoritma dan Kompleksitas', '1.4 Jenis-jenis Proses Algoritma', 'BAB 1. Introduction', 'Langkah yang membentuk suatu algoritma dapat dibagi manjadi 4 kelompok proses sebagai berikut:\r\n\r\n1) Sequence Proces\r\n\r\nSequence adalah struktur algoritma paling dasar yang berisi rangkaian intruksi yang diproses secara berurutan, satu per satu, mulai dari intruksi pertama sampai akhir sesuai dengan urutan penulisan algoritma yang dibuat. Sequence algoritma sendiri terdiri dari satu atau lebih intruksi, yang berarti bahwa :\r\n\r\nTiap intruksi dikerjakan satu persatu.\r\nTiap intruksi dilaksanakan sekali, dan tidak ada intruksi yang diulang.\r\nUrutan intruksi yang dilaksanakan sama dan sesuai dengan intruksi yang dibuat\r\nAkhir dari intruksi terakhir merupakan akhir algoritma\r\n\r\n2) Selection Process\r\n\r\nSaat algoritma kita dijalankan ada saat dimana suatu instruksi baru boleh dijalankan jika kondisi tertentu terpenuhi. Contohnya saat kita menerima raport atau nilai semester, disana akan ada kondisi yang menyatakan jika nilai kita lebih besar dari 80 maka kita mendapat A, jika nilai lebih besar dari 70 maka kita mendapat B, dan seterusnya. \r\n\r\n3) Repetition Process\r\n\r\nSalah satu manfaat penggunaan komputer adalah kemampuan mengulang sesuatu dengan cepat dan akurat. Dalam algoritma, struktur perulangan ini sangat bermanfaat jika kita ingin melakukan sebuah proses yang sama berulang-ulang dengan kondisi tertentu, contohnya jika kita ingin program yang kita buat terus berjalan selama pengguna tidak memilih pilihan keluar, contoh sederhana lainnya adalah jika kita ingin mencetak bilangan dari 1 sampai 100 dan masih banyak lagi yang lainnya. \r\n\r\n4) Iteration Proces\r\n\r\nsifat tertentu dari algoritma atau program komputer di mana suatu urutan atau lebih dari langkah algoritmik dilakukan di loop program. iterasi dapat diartikan sebagai suatu proses atau metode yang digunakan secara berulang-ulang (pengulangan) dalam menyelesaikan suatu permasalahan matematik.\r\n\r\nPerulangan yang dimaksud adalah seperti perintah-perintah while .. do ataupun for .. do. Perulangan akan terus terjadi selama kondisinya terpenuhi. Perulangan yang umum kita gunakan seperti pada program deret fibonanci, prima, genap, ganjil atau lainnya.', 'kilojoule : 192  kj\r\nkalori : 46 kkal.\r\nlemak : 0,27 g.\r\nprotein : 0,5 g.\r\nkarbohidrat 11,66 g.\r\nkalium : 126 mg.', 'Mengontrol diabetes.\r\nMengatasi diare dan kembung.\r\nMenurunkan kadar kolesterol.\r\nMelawan infeksi jamur.', 'Kingdom	: Plantae (Tumbuhan).\r\nSubkingdom	: Tracheobionta (Tumbuhan berpembuluh).\r\nSuper Divisi	: Spermatophyta (Menghasilkan biji).\r\nDivisi		: Magnoliophyta (Tumbuhan berbunga).\r\nKelas		: Magnoliopsida (berkeping dua / dikotil).\r\nSub Kelas	: Rosidae.\r\nOrdo		: Myrtales.\r\nFamili		: Myrtaceae (suku jambu-jambuan).\r\nGenus		: Eugenia.\r\nSpesies	: Eugenia aquea Burm.F (Sumber: www.petanihebat.com).\r\n', '', NULL, '2019-10-03 10:30:01', '2019-10-02 03:37:37', 1, 1),
('2019-10-02-5d94bc0ec0e59', 'Algoritma dan Kompleksitas', '1.2 Aspek-aspek Penting Algoritma', 'BAB 1. Introduction', 'Dalam Algoritma terdapat 5 aspek penting menurut ahli Donald E.Knuth yaitu :\r\n\r\nDefiniteness : Definiteness adalah definisi harus tepat dan tidak ambigu.\r\nEffectiveness : Effectiveness adalah harus dilakukan secara cepat dan tepat.\r\nFiniteness : Fineteness adalah harus berhenti setelah mengerjakan langkah terbatas.\r\nInput : Inputnya harus 0 atau lebih yang diberikan kepada algoritma\r\nOutput : Outputnya harus 1 atau lebih.Biasanya tergantung pada inputnya', 'kilojoule : 29  kj\r\nkalori : 7 kkal.\r\nlemak : 0,02 g.\r\nprotein : 0,06 g.\r\nkarbohidrat : 1,79 g.\r\nsodium : 1 mg.\r\nkalium : 4 mg.', 'Buah matoa dapat meningkatkan daya tahan tubuh. \r\nMembantu Mengurangi Stres\r\nyang Anda Alami karena dalam buah matoa terkandung zat yang dapat berfungsi sebagai\r\nobat penenang. \r\nMengurangi Risiko Kanker. buah matoa mengandung antioksidan yang dapat\r\nmencegah pertumbuhan sel-sel kanker yang disebabkan karena radikal bebas.\r\nMembantu\r\nMengurangi Risiko Jantung.\r\nmenjaga Kesehatan Kulit. \r\nSebagai Sumber Energi Alternatif.\r\nmelancarkan penceranaan.', 'Kingdom : Plantae. \r\nDivisi  : Magnoliophyta. \r\nKelas  : Magnoliopsida. \r\nOrdo  : Sapindales. \r\nFamili  : Sapindaceae. \r\nGenus  : Pometia. \r\nSpesies : Pometia pinnata.', '', NULL, '2019-10-03 10:32:22', '2019-10-02 15:02:38', 1, 1);
